description:
A handheld version of Namco's venerated fighting series, this PSP game is based on the arcade expansion to Tekken 5. Dark Resurrection features over 30 characters, including Dragonuv and Lili, the two new characters that were added for the Dark Resurrection arcade update. Also making the trip over from the arcade are new stages, themselves based off the original Tekken 5 stages, but with climate and time effects as well as new background objects, totalling 19 stages.

Emulated with PPSSPP 0.9.6 (Xbox360 controller compatible)

Apart from some scratchy audio in the lead in commentary from time to time, this is a damn near perfect emulation; I found this more fun than Tekken 6.

System Requirements:

Core 2 duo 2.4GHz or higher.
nVidia GeForce GT 620 / ATI Radeon HD 5 series or higher.
3 Gig of ram or more.
Windows XP / Vista / 7 / 8 32 or 64bit OS.

